import React from "react";
import "./Rules.css";

export default function Rules() {
    return (
        <div id="text">
            Before play begins,  a number of consecutive squares on the grid, arranged either horizontally or vertically


            Player's take turns guessing by calling out the coordinates. 
            Both players should mark their board with pegs:  red X for hit, green check for miss.
        </div>
    )
}
